#
# Structure for table "tp_work"
#

DROP TABLE IF EXISTS `tp_work`;
CREATE TABLE `tp_work` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '就业信息提交主键',
  `account` varchar(255) NOT NULL COMMENT '学号',
  `danwei` varchar(255) DEFAULT NULL COMMENT '目前就业单位',
  `xingzhi` varchar(255) DEFAULT NULL COMMENT '工作性质',
  `daiyu` varchar(255) DEFAULT NULL COMMENT '工资待遇',
  `fangxiang` varchar(255) DEFAULT NULL COMMENT '理想就业方向',
  `yixiang` varchar(255) DEFAULT NULL COMMENT '意向工作地区',
  `isdelete` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '删除状态，1-删除 | 0-正常',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `account` (`account`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='就业信息提交';

